test("Parses types", () => {
  // Plains
  expect(getItem(card_plains_eld, "type_line.parseSuperTypes")).toEqual([
    "Basic",
  ]);
  expect(getItem(card_plains_eld, "type_line.parseTypes")).toEqual(["Land"]);
  expect(getItem(card_plains_eld, "type_line.parseSubTypes")).toEqual([
    "Plains",
  ]);

  // Aether Adept
  expect(
    getItem(card_aether_adept_ddm, "type_line.parseSuperTypes")
  ).toHaveLength(0);
  expect(getItem(card_aether_adept_ddm, "type_line.parseTypes")).toEqual([
    "Creature",
  ]);
  expect(getItem(card_aether_adept_ddm, "type_line.parseSubTypes")).toEqual([
    "Human",
    "Wizard",
  ]);

  // Fireball
  expect(getItem(card_fireball_mb1, "type_line.parseSuperTypes")).toHaveLength(
    0
  );
  expect(getItem(card_fireball_mb1, "type_line.parseTypes")).toEqual([
    "Sorcery",
  ]);
  expect(getItem(card_fireball_mb1, "type_line.parseSubTypes")).toHaveLength(0);

  // Niv-Mizzet
  expect(getItem(card_niv_mizzet_c17, "type_line.parseSuperTypes")).toEqual([
    "Legendary",
  ]);
  expect(getItem(card_niv_mizzet_c17, "type_line.parseTypes")).toEqual([
    "Creature",
  ]);
  expect(getItem(card_niv_mizzet_c17, "type_line.parseSubTypes")).toEqual([
    "Dragon",
    "Wizard",
  ]);

  // Chandra
  expect(getItem(card_chandra_zen, "type_line.parseSuperTypes")).toEqual([
    "Legendary",
  ]);
  expect(getItem(card_chandra_zen, "type_line.parseTypes")).toEqual([
    "Planeswalker",
  ]);
  expect(getItem(card_chandra_zen, "type_line.parseSubTypes")).toEqual([
    "Chandra",
  ]);
});

